import React from 'react'
import { View, Text } from 'react-native'
import { StatusBar } from "react-native";

const NavBar = () => {
  return (
    <View>
        <StatusBar>
        <Text style= {{ color: 'white', flex: 1, marginTop: 10, backgroundColor: 'green'}}>Soy el navbar</Text>
        </StatusBar>
    </View>
  )
}

export default NavBar
